    'parent' => 5013,
    'isfolder' => 0,
    'introtext' => '',
    'content' => '<div>На общественном обсуждении находится проект федерального закона «О внесении изменений в Федеральный закон «Об исполнительном производстве» и Федеральный закон «О государственной регистрации юридических лиц и индивидуальных предпринимателей» (в части совершенствования порядка исполнения судебных актов, актов других органов и должностных лиц) (далее - законопроект) направлен на оптимизацию порядка исполнения требований исполнительных документов имущественного характера, должниками по которым являются организации.<br />В целях понуждения должника к полному, правильному и своевременному исполнению требований исполнительного документа, законопроектом предусмотрены изменения в Федеральный закон от 02.10.2007 № 229-ФЗ<br />‎«Об исполнительном производстве» и Федеральный закон от 08.08.2001 № 129-ФЗ «О государственной регистрации юридических лиц и индивидуальных предпринимателей».<br />В целях исключения случаев уклонения должников-организаций<br />‎от исполнения требований исполнительных документов имущественного характера путем ликвидации, реорганизации юридического лица предлагается перечень документов, необходимых для регистрации создаваемого юридического лица, регистрации юридического лица, создаваемого путем реорганизации, а также для регистрации физического лица в качестве индивидуального предпринимателя дополнить справкой об отсутствии непогашенной задолженности по исполнительным производствам, информация о которых включена в банк данных, содержащий сведения, необходимые для осуществления задач по принудительному исполнению судебных актов, актов других органов и должностных лиц.<br />Кроме того, предлагается в случае приостановления банком или иной кредитной организацией операций с имеющимися денежными средствами на счетах должника-организации в соответствии с частью 6 статьи 81 Федерального закона<br />‎от 02.10.2007 № 229-ФЗ «Об исполнительном производстве» запретить банкам или и иным кредитным организациям открывать должнику-организации счета, вклады, депозиты и предоставлять ей право использовать новые корпоративные электронные средства платежа для переводов электронных денежных средств.<br />Порядок информирования банков или иных кредитных организаций<br />‎о приостановлении операций с имеющимися денежными средствами на счетах должника-организации и отмене приостановления таких операций предлагается установить Федеральной службе судебных приставов по согласованию<br />‎с Центральным банком Российской Федерации<br />В связи с необходимостью издания правовых актов Минюста России и ФССП России вступление в силу законопроекта отложено на 3 месяца с момента официального опубликования Федерального закона.<br />Реализация законопроекта не повлечет расходов из федерального бюджета, иных бюджетов бюджетной системы Российской Федерации, а также не потребует увеличения штатной численности заинтересованных органов государственной власти и организаций.<br />Законопроект не противоречит положениям Договора о Евразийском<br />‎экономическом союзе, а также положениям иных международных договоров Российской Федерации.</div>',
